Buk blong Momon: Wan Narafala Testeman blong Jisas Kraes
Wan mesenja blong heven we nem blong hem &lt;a href="Moronae"&gt;Moronae&lt;/a&gt; i lidim &lt;a href="Josef%20Smit"&gt;Josef Smit&lt;/a&gt; long wan hil we ol gol plet i bin stap slip haed blong plante senturi. Ol gol plet ia oli tekem ol raeting blong ol profet we oli talemaot stori blong wanem we God i bin mekem wetem ol fas man we i bin stap long &lt;a href="Amerika"&gt;Amerika&lt;/a&gt;. Josef Smit i bin transletem wanem i bin stap insaed long ol plet ia tru long paoa blong God. Ol profet insaed long Buk blong Momon oli bin save abaot misin blong Sevya mo oli bin tijim gospel blong Hem. Taem Hem i laef bakegen long ded, Kraes i bin kamaot long ol pipol ia. Hem i bin tijim olgeta gospel blong Hem mo Hem i bin stanemap Jos blong Hem. Buk blong Momon i pruvum se God i toktok long man mo i stap singaotem olgeta blong mekem tabu wok blong hem long taem tedei mo jeneresen ia semmak olsem wetem ol jeneresen bifo.
Presiden &lt;a href="Ezra%20Taft%20Benson"&gt;Ezra Taft Benson&lt;/a&gt; i bin talem se Buk blong Momon i ki ston long trifala wei:
Buk blong Momon i Testefae abaot Kraes.
Wan stamba tingting blong Buk blong Momon i blong mekem tingting blong ol pipol i kam strong se Jisas Hem i Kraes.

